metadata:
  name: nested-dir-test-func
  annotations: {}
spec:
  description: ""
  disable: false
  triggers:
    myHttpTrigger:
      attributes:
        cors:
          allowMethods:
          - GET
          - PATCH
          - OPTIONS
          - POST
          allowOrigins:
          - '*'
          enabled: true
        ingresses:
          '0':
            host: cors-func-qzeu.default-tenant.app.dev72.lab.iguazeng.com
            paths:
            - /
            secretName: presto-tls
          serviceType: ClusterIP
      kind: http
  env: []
  loggerSinks:
    - level: debug
      sink: ""
  handler: "handler:handler"
  runtime: "python:2.7"
  build:
    image: ""
    dependencies: []
    runtimeAttributes:
      repositories: []
  targetCPU: 75
  minReplicas: 1
  maxReplicas: 1
